const Shop = () => {
    return(
        <>
        <h1>Welcome to my shop</h1>
        <ul>
            <li>Apples</li>
            <li>Grapes</li>
            <li>Pears</li>
            <li>Oranges</li>
            <li>Kiwi</li>
        </ul>
        </>
    )
}

export default Shop;
